import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import IssuesPage from './pages/issuePage';

function App() {
  return (
    <BrowserRouter>
      <div className="App">

        <Routes>
          <Route path="/" element={<IssuesPage />}> </Route>
        </Routes>

      </div>
    </BrowserRouter>
  );
}

export default App;
